sys_variable_value.value:
(function execute(inputs, outputs) {
    var util = new AmazonECSUtil();
    var session = gs.getSession();
    var query_string = [];
    inputs = util.trimString(inputs);
    var capcity_provider = util.buildPayload(inputs.capacity_provider,
        "capacityProviderStrategy.member.", ["base", "weight", "capacityProvider"]);
    var placement_constraints = util.buildPayload(inputs.placement_constraints,
        "placementConstraints.member.", ["expression", "type"]);
    var placement_strategy = util.buildPayload(inputs.placement_strategy,
        "placementStrategy.member.", ["field", "type"]);
    if (capcity_provider) query_string.push(capcity_provider);
    if (placement_constraints) query_string.push(placement_constraints);
    if (placement_strategy) query_string.push(placement_strategy);
    session.putClientData("SN_AMAZON_ECS_REGION", inputs.region || "us-east-1");
    session.putClientData("SN_AMAZON_ECS_FILTER", query_string.join("&"));
    outputs.region = inputs.region;
    outputs.cluster_name = inputs.cluster_name;
    outputs.service_name = inputs.service_name;
    outputs.desired_count = inputs.desired_count;
    outputs.health_check_grace = inputs.health_check;
    outputs.task_definition = inputs.task_definition

})(inputs, outputs);

